  RGBToHSL (r, g, b) {
    // Make r, g, and b fractions of 1
    r /= 255
    g /= 255
    b /= 255

    // Find greatest and smallest channel values
    const cmin = Math.min(r, g, b)
    const cmax = Math.max(r, g, b)
    const delta = cmax - cmin
    let h = 0
    let s = 0
    let l = 0

    // Calculate hue
    // No difference
    if (delta === 0) {
      h = 0
    } else if (cmax === r) {
      // Red is max
      h = ((g - b) / delta) % 6
    } else if (cmax === g) {
      // Green is max
      h = (b - r) / delta + 2
    } else {
      // Blue is max
      h = (r - g) / delta + 4
    }

    h = Math.round(h * 60)

    // Make negative hues positive behind 360
    if (h < 0) { h += 360 }

    // Calculate lightness
    l = (cmax + cmin) * 0.5

    // Calculate saturation
    s = delta === 0 ? 0 : delta / (1 - Math.abs(2 * l - 1))

    // Multiply l and s by 100
    s = +(s * 100).toFixed(1)
    l = +(l * 100).toFixed(1)

    // return 'hsl(' + h + ',' + s + '%,' + l + '%)'
    return [h, s, l]
  },
  HSLToRGB (h, s, l) {
    // Must be fractions of 1
    s *= 0.01
    l *= 0.01

    const c = (1 - Math.abs(2 * l - 1)) * s
    const x = c * (1 - Math.abs((h / 60) % 2 - 1))
    const m = l - c * 0.5
    let r = 0
    let g = 0
    let b = 0
    if (h >= 0 && h < 60) {
      r = c
      g = x
      b = 0
    } else if (h >= 60 && h < 120) {
      r = x
      g = c
      b = 0
    } else if (h >= 120 && h < 180) {
      r = 0
      g = c
      b = x
    } else if (h >= 180 && h < 240) {
      r = 0
      g = x
      b = c
    } else if (h >= 240 && h < 300) {
      r = x
      g = 0
      b = c
    } else if (h >= 300 && h < 360) {
      r = c
      g = 0
      b = x
    }
    r = Math.round((r + m) * 255)
    g = Math.round((g + m) * 255)
    b = Math.round((b + m) * 255)
    return [r, g, b]
  },
  processImage (inImg) {
    // const width = inImg.width
    // const height = inImg.height
    const src = new Uint32Array(inImg.data.buffer)
    const isValueHistogram = true

    const histBrightness = (new Array(256)).fill(0)
    const histR = (new Array(256)).fill(0)
    const histG = (new Array(256)).fill(0)
    const histB = (new Array(256)).fill(0)

    for (let i = 0; i < src.length; i++) {
      const r = src[i] & 0xFF
      const g = (src[i] >> 8) & 0xFF
      const b = (src[i] >> 16) & 0xFF
      histBrightness[r]++
      histBrightness[g]++
      histBrightness[b]++
      histR[r]++
      histG[g]++
      histB[b]++
    }

    let maxBrightness = 0
    if (isValueHistogram) {
      for (let i = 1; i < 256; i++) {
        if (maxBrightness < histBrightness[i]) {
          maxBrightness = histBrightness[i]
        }
      }
    } else {
      for (let i = 0; i < 256; i++) {
        if (maxBrightness < histR[i]) {
          maxBrightness = histR[i]
        } else if (maxBrightness < histG[i]) {
          maxBrightness = histG[i]
        } else if (maxBrightness < histB[i]) {
          maxBrightness = histB[i]
        }
      }
    }

    const canvas = document.getElementById('canvasHistogram')
    const ctx = canvas.getContext('2d')
    const guideHeight = 8
    const startY = (canvas.height - guideHeight)
    const dx = canvas.width / 256
    const dy = startY / maxBrightness
    ctx.lineWidth = dx
    ctx.fillStyle = '#fff'
    ctx.fillRect(0, 0, canvas.width, canvas.height)

    for (let i = 0; i < 256; i++) {
      const x = i * dx
      if (isValueHistogram) {
        // Value
        ctx.strokeStyle = '#000000'
        ctx.beginPath()
        ctx.moveTo(x, startY)
        ctx.lineTo(x, startY - histBrightness[i] * dy)
        ctx.closePath()
        ctx.stroke()
      } else {
        // Red
        ctx.strokeStyle = 'rgba(220,0,0,0.5)'
        ctx.beginPath()
        ctx.moveTo(x, startY)
        ctx.lineTo(x, startY - histR[i] * dy)
        ctx.closePath()
        ctx.stroke()
        // Green
        ctx.strokeStyle = 'rgba(0,210,0,0.5)'
        ctx.beginPath()
        ctx.moveTo(x, startY)
        ctx.lineTo(x, startY - histG[i] * dy)
        ctx.closePath()
        ctx.stroke()
        // Blue
        ctx.strokeStyle = 'rgba(0,0,255,0.5)'
        ctx.beginPath()
        ctx.moveTo(x, startY)
        ctx.lineTo(x, startY - histB[i] * dy)
        ctx.closePath()
        ctx.stroke()
      }
      // Guide
      ctx.strokeStyle = 'rgb(' + i + ', ' + i + ', ' + i + ')'
      ctx.beginPath()
      ctx.moveTo(x, startY)
      ctx.lineTo(x, canvas.height)
      ctx.closePath()
      ctx.stroke()
    }
  },
